script: |
  super -f text -I q8129.spq | sort > q8129.out

inputs:
  - name: q8129.spq
    data: |
      SELECT DISTINCT col2 FROM tab0 (FORMAT parquet) WHERE + + col1 * col2 NOT BETWEEN 18 / 76 - - 69 AND + col1 / + 10;
  - name: tab0

outputs:
  - name: q8129.out
    data: |
      10
      47
      99
